import React from 'react'
import './NavBar.css'

interface NavBarProps {
    renderLinks: JSX.Element[]
}

const NavBar: React.FC<NavBarProps> = props => {
    return (
        <div id='NavBar'>
            <div id='title'>
                <h1 id='title-lynette' className='title-lynette'>LYNETTE'S</h1>
                <h1 id='title-skin-studio' className='title-skin-studio'>SKIN STUDIO</h1>
            </div>
            <div>
                <ul>
                    { props.renderLinks }
                </ul>
            </div>
        </div>
    )
}

export default NavBar
